// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./ConsumerInventoryStorage.sol";


contract ConsumerInventoryService {

     // Address of Organization che gestisce gli utenti
    address private  ConsumerOrg;

    ConsumerInventoryStorage private consumerInventoryStorage;

    constructor(address _consumerInventoryStorage){
        ConsumerOrg = msg.sender;
        consumerInventoryStorage = ConsumerInventoryStorage(_consumerInventoryStorage);
    }

    // Eventi per notificare l'aggiunta e l'eliminazione dei dati
    event CheesePieceAdded(address indexed userAddress, string message, string dop, uint256 quantity, uint256 price);
    event CheesePieceDeleted(address indexed userAddress, uint256 indexed id, string message);

    function addCheesePiece(address walletRetailer, string memory _dop, uint256 _quantity, uint256 _price) external {
        address walletConsumer = msg.sender;
        // Verifico che l'address sia diverso da quello di Deploy 
        require(walletConsumer != ConsumerOrg,"Address non Valido!");
        //Call function of Storage 
        consumerInventoryStorage.addCheesePiece(walletConsumer, walletRetailer, _quantity, _price);
        // Emissione dell'evento 
        emit CheesePieceAdded(walletConsumer, "Pezzo di formaggio inserito !", _dop, _quantity, _price);
    }

    // Get CheesePiece -> address of  
    function getCheesePiece(uint256 _id) external view returns (uint256, string memory, uint256, uint256, uint256) {
        // Retrieve msg.sender 
        address walletConsumer = msg.sender;

        //return consumerInventoryStorage.getCheesePiece(walletConsumer,_id);
    }



    // Delete Cheese piece 
    // We can delete a cheese piece with -> address of Consumer and id of CheesePiece
    function deleteCheesePiece(uint256 _id) external returns(bool value) {
        // Retrieve msg.sender 
        address walletConsumer = msg.sender;

        if(consumerInventoryStorage.deleteCheesePiece(walletConsumer,_id)){
            emit CheesePieceDeleted(walletConsumer,_id,"Pezzo di Formaggio e' stato eleminato");
            return true;
        }else {
            return false;
        }
    }
}

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ConsumerInventoryStorage {

     // Address of Organization che gestisce gli utenti
    address private  ConsumerOrg;

    constructor(){
        ConsumerOrg = msg.sender;
    }

    struct CheesePiece {
        uint256 id;
        uint256 quantityTotal;
        uint256 pricePerKg; 
        address walletRetailer;
    }

    
    mapping(address => mapping(uint256 => CheesePiece)) private cheesePieces;


    // Add function to add CheesePiece
    function addCheesePiece(address _walletRetailer,address _walletConsumer, uint256 _quantity, uint256 _price) external {
        // Generazione dell'ID 
        uint256 _id = uint256(keccak256(abi.encodePacked(
            _quantity,
            _price,
            _walletConsumer,
            _walletRetailer
        )));

        require( cheesePieces[_walletConsumer][_id].id == 0, "Pezzo di Formaggio gia' presente!");

        //Crea una nuova Partita di Latte
        CheesePiece memory cheesePiece = CheesePiece({
            id: _id,
            quantityTotal: _quantity,
            pricePerKg: _price,
            walletRetailer:_walletRetailer
        });

        //Inserisce la nuova Partita di Latte nella lista milkBatches
        cheesePieces[_walletConsumer][_id] = cheesePiece;
    }

    // Get CheesePiece -> address of  
    function getCheesePiece(address walletConsumer, uint256 _id) external view returns (uint256, uint256, uint256) {

        require( cheesePieces[walletConsumer][_id].id == _id, "Partita di Latte non presente!");

        CheesePiece memory cheesePiece = cheesePieces[walletConsumer][_id];

        return (cheesePiece.id, cheesePiece.quantityTotal, cheesePiece.pricePerKg);
    }

    function deleteCheesePiece(address walletConsumer, uint256 _id) external returns(bool value) {

        require(cheesePieces[walletConsumer][_id].id != 0, "Partita di Latte non presente!");

        uint256 lastIdMilkBatch = uint256(keccak256(abi.encodePacked(
            cheesePieces[walletConsumer][_id].quantityTotal,
            cheesePieces[walletConsumer][_id].pricePerKg,
            cheesePieces[walletConsumer][_id].walletRetailer,
            walletConsumer
        )));

        require(cheesePieces[walletConsumer][_id].id == lastIdMilkBatch, "Utente non Autorizzato!");
        // Delete piece of Cheese
        delete cheesePieces[walletConsumer][_id];
        // Check CheesePiece in the mapping 
        if(cheesePieces[walletConsumer][_id].id  == 0){
            return true;
        }else {
            return false;
        }
    }
}

